import * as React from 'react';
import { View} from 'react-native';
import { Button } from 'react-native-web';
import { Header,
        Container,
        Title,
        Text2,
        HeaderButtonLeft,
        HeaderButtonRight,
        Container1,
        Text1,
        Container2,
        Text3,
        Container3,
        Text4
      } 
from './styles';
import { Entypo } from '@expo/vector-icons';
import { Ionicons } from '@expo/vector-icons';

function BreakfastScreen({navigation,route}) {
  const item = route.params;
  return (
    <View>
      <Container>
        <Header>
          <HeaderButtonLeft>
            <Ionicons name="chevron-back" size={20} color={"black"} onPress={navigation.goBack} />
          </HeaderButtonLeft>
          <HeaderButtonRight>
            <Entypo name="dots-two-horizontal" size={20} color="#1D1617" />
          </HeaderButtonRight>
          <Title>Breakfast</Title>
        </Header>
        <Container1>
          <Text1>Search Pancake</Text1>
        </Container1>
        <Text2>Category</Text2>
        <Container2>
          <Text3>Salad</Text3>
        </Container2>
        <Container3>
          <Text4>Cake</Text4>
        </Container3>
        <Button
          title="Go to Bluebarry Pancake"
          onPress={() => navigation.navigate('Bluebarry Pancake')}
        />
        
      </Container>
    </View>
  );
}
export default BreakfastScreen;
